import './App.css';
import { BrowserRouter, Route, Router } from 'react-router-dom';
import Main from './pages/Main';
import Login from './pages/Login'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Route path="/" component={Main}/>
        <Route path="/login" Component={Login}/>
      </BrowserRouter>

    </div>
  );
}

export default App;
